  };

  return (
    <li>
      <h3>{pokemon.pokemon.name}</h3>
      <img src="https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/versions/generation-iv/diamond-pearl/37.png"></img>
      <ul>
        {pokemon.version_details[1]
          ? pokemon.version_details[1].encounter_details.map((detail) => {
              return (
                <li>
                  <p>Method: {detail.method.name}</p>
