                    Condition:
                    {detail.condition_values[0] != undefined
                      ? detail.condition_values[0].name
                      : null}
                  </p>
                </li>
              );
            })
          : pokemon.version_details[0].encounter_details.map((detail) => {
              return (
                <li>
                  <p>Method: {detail.method.name}</p>
